// Navbar.js
import React from 'react';
import { Link } from 'react-router-dom'; // If using React Router
import '../navbar/Navbar.css';


const Navbar = () => {
  return (
    <nav className="navbar">
      
      <div>
        
      </div>

      <div className="auth-buttons">
        <button>Login</button>
        <button>Sign Up</button>
      </div>


    </nav>
  );
};

export default Navbar;
